import React from 'react';
import '../assets/styles.css';

const Login = () => {
  return (
    <section className="home" style={{ paddingTop: '10rem' }}>
      <div className="content" style={{ textAlign: 'center' }}>
        <h3>Login to <span>BioFresh</span></h3>
        <form className="login-form" style={{ maxWidth: '400px', margin: 'auto' }}>
          <input type="email" placeholder="Email" className="btn" style={{ width: '100%', marginBottom: '1rem' }} />
          <input type="password" placeholder="Password" className="btn" style={{ width: '100%', marginBottom: '1rem' }} />
          <button className="btn" style={{ width: '100%' }}>Login</button>
        </form>
      </div>
    </section>
  );
};

export default Login;
